import React from "react";
import Box from '@mui/material/Box';
import './ChatPage.css'
import { TextField } from "@mui/material";
import SearchIcon from '@mui/icons-material/Search';

export default function ChatPage () {
    return (
        <div className='chat-page'>
            <Box
                className='contact-box'
                height={650}
                width={300}
                my={6}
                mx={14}
                display="flex"
                alignItems="center"
                gap={4}
                p={2}
                sx={{ 
                    border: '2px solid black',
                    backgroundColor: 'white' 
                }}
            >
                <TextField className='search-bar' label='Search' variant='outlined' size='small' />
                <SearchIcon color="b"/>

            </Box>
            <Box
                className='chat-box'
                height={650}
                width={700}
                my={36}
                display="flex"
                alignItems="center"
                gap={4}
                p={2}
                sx={{ 
                    border: '2px solid black',
                    backgroundColor: 'white' 
                }}
            >
            </Box>
        </div>
    )
}
